import React from 'react';
import withData from '../../with-data';

    const TestUserProfile = ({data}) => (
        <div className='container'>
            <h1>{this.props.name}</h1>
            <h2>{this.props.email}</h2>
            Posts:
            <div>
                {data.map(post => 
                    <div className='post' key={post.id}>
                        <h1>{post.title}</h1> 
                        <p>{post.body}</p> 
                    </div>
                )}
            </div>
        </div>
    )
export default withData(TestUserProfile, 'https://jsonplaceholder.typicode.com/posts');
